{"5": ["MARKETHOT\nОрганайзер на спинку сиденья автомобиля \"Универсальный\". Из всего можно отдельно похвалить полиэтиленовую упаковку внутри уже вскрытой коробки, в которой был упакован органайзер. Само изделие не качественное (швы не ровно прострочены, нитки торчат, шнурки для фиксации сразу \"расплелись\", фиксаторные кольца для шнурков повыпадали в один момент)... Сам вид \"кармашков\" из сетки: как будто прошлись горячим утюгом и расплавили(. Нижняя часть не удобно фиксируется (не буду кревить душой - совсем не фиксируется) на спинке автомобильного кресла. В верхних фиксаторах не предусмотрена регулировка.  Не советую покупать данную модель, может обратите внимание на другие, подороже, с продуманной фиксацией и изначально держащие форму...", "2021-04-02T15:56:08Z", "черный", "0", 1, 0, 1, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "11": ["Пришёл со следами непонятного происхождения, похожими на плесень. Жаль. Коробка рваная. Сам органайзер неплохой.", "2021-02-20T09:16:46Z", "черный", "0", 1, 0, 3, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "23": ["Хороший,удобный,нитки не торчат", "2020-11-17T08:45:22Z", "черный", "0", 0, 1, 5, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "33": ["Отличный органайщер детям для длительных поездок. Чуть уже спинки сиденья. В комплекте доя крепления были резинки, я заментла стропами, так как при укладывании в карманы планшета, воды, еды и мелрчей резинки растягивались и сильно провисали.", "2019-10-19T19:12:37.596345542Z", "черный", "0", 1, 0, 5, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "36": ["Заказала 2 таких органайзера, Олин пришел с дефектом, пришлось оформить отказ и заказывать новый.", "2019-07-07T10:39:10.252954926Z", "черный", "0", 1, 1, 1, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "37": ["Товар пришёл не тот, который я заказывала. Но так, как времени на обмен и возврат нет, то пришлось его забрать. Очень печально.", "2019-06-28T14:44:53.739429032Z", "черный", "0", 0, 6, 1, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "38": ["Пришел совсем другой органайзер, фото не соответствует действительности и качество плохое. ", "2019-06-19T15:34:02.326091416Z", "черный", "0", 2, 1, 1, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "39": ["Товар пришел в ненадлежащем качестве (все испачкано белыми пятнами, которые не оттираются). Прошу не учитывать в процент скидки.", "2019-06-18T07:56:43.787542247Z", "черный", "0", 2, 0, 1, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "40": ["Пришёл совсем не тот, что на картинке, но я забрала.", "2019-06-17T06:44:23.629723071Z", "черный", "0", 1, 0, 3, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "41": ["Фото на сайте не соответствует", "2019-06-15T14:25:50.986449133Z", "черный", "0", 1, 0, 3, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "42": ["Вернула.Полное несоответствие товара!прошу не учитывать процент", "2019-06-14T12:11:46.949533599Z", "черный", "0", 1, 0, 1, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "43": ["Пришел абсолютно другой товар. Прошу не учитывать в процент выкупа", "2019-06-10T16:39:11.798708659Z", "черный", "0", 3, 0, 1, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "44": ["Размер на фото больше. Не допрошито в некоторых местах.", "2019-02-27T19:41:38.693694745Z", "черный", "0", 2, 0, 3, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "45": ["Тоже другой товар, но я взяла в подарок! Мужу понравилось!", "2019-02-22T21:22:45.557040391Z", "черный", "0", 2, 0, 3, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "46": [". Полное не соответствие с фото!!!!! Ужасная тряпочка очень низкого качества. ", "2019-02-13T06:07:00.912680018Z", "черный", "0", 4, 1, 3, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "47": ["Я молодая мама...в машине надо все распределить удобно и компактно...брала для дальних поездок...Не рекомендую..весьма настроена...карманы малогабаритных...бутылочку в отделение для напитков ставить не удобно..одного шнурка в комплекте как крепление нет...сшито не аккуратно...Вообще отказ и не соответствие...прошу не учитывать процент выкупа ...так как упаковка нарушена и есть недокомплектация", "2019-01-01T16:26:20.317692079Z", "черный", "0", 5, 3, 2, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "49": ["2 раза заказывала и оба раза привозили органайзер, не соответствующий фото. Прошу разобраться, все пишут о неправильном вложении, а магазин работает \"на все 100%\", только не в пользу покупателя. Или измените картинку.", "2018-12-03T20:34:52.222006482Z", "черный", "0", 4, 0, 1, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "50": ["Доставленный товар не соответствует картинке, а мне был нужен именно как на картинке", "2018-12-03T17:08:43.968799004Z", "черный", "0", 2, 0, 1, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "51": ["Неожиданно быстро!", "2018-11-27T16:54:59.962268665Z", "черный", "0", 2, 1, 5, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "52": ["Таже ситуация, положили не тот органайзер в заказ", "2018-11-06T10:26:01.616795233Z", "черный", "0", 3, 0, 1, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "53": ["Совершенно не соответствует фото! Качество ужасное! ", "2018-10-20T20:36:38.003620792Z", "черный", "0", 7, 1, 1, "Органайзер на спинку сиденья автомобиля \"Универсальный\"", "MARKETHOT"], "54": ["Совершенно другой товар.Тонкая плащевка с оторванным карманом, отсутствием липучек и торчащими нитками. Отказ.", "2018-10-05T15:25:41.605166228Z", "черный", "0", 9, 3, 1, "Органайзер на спинку сиденья авт